import React, { useEffect } from "react";
import { useState } from "react";
import { color, motion } from "framer-motion";
import NavBar from "../Components/navbar";
import './service.css'
import landingImg from '../Images/Screenshot (1174).png';
import imgSea from '../Images/Screenshot (1175).png'
export default function Page2(){
  
  
  
  
    return ( 
      <div>
        
       
       <section className="header-about">
          <NavBar/>
          <div className="landing">
                        <motion.h1 
                            initial={{opacity:0}}
                            whileInView={{opacity:1}}
                            exit={{opacity:0}}
                            transition={{duration:3}}    
                            id="header">Sanda Asapuwa</motion.h1>

                        <motion.button className="btnBook"  
                                initial={{y:-50,opacity:0}}
                                whileInView={{y:-10,opacity:1}}
                                exit={{y:-50,opacity:0}}
                                transition={{ delay:1,duration:1}}   
                        >Book Now</motion.button>
                    </div>
       </section>
    

    </div>
    
    
    
    
    
    )
       
    
        
    
}
